// import logo from "./logo.svg";
import "./App.css";
import { Navbar } from "./components/Landing/Navbar";

import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />
        <Routes>
          <Route path="/"></Route>
          <Route path="/"></Route>
          <Route path="/"></Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
